Rules.InvariantScript:
// Always create the collection (empty, with Cat as text)
ClearCollect(colKBCatPick, { Cat: "" });
Clear(colKBCatPick); // slightly cleaner than RemoveIf(..., true)

// Clear search
Reset(txtKBSearch);

// Modal defaults
Set(varKBOpen, false);
Set(varKBMode, Blank());

Clear(colBreadcrumbs);
Set(varModalLevel, 0);

// This is inside cmpNav's gallery
Set(varMenuKey, ThisItem.ScreenName);
cmpNav.OnNavigate(ThisItem.ScreenName);

// Optional: Add breadcrumb (only if colBreadcrumbs is global)
With(
    {
        newID: CountRows(colBreadcrumbs) + 1,
        scr: Switch(
                ThisItem.ScreenName,
                "Launch Pad", LaunchPad,
                "Brain Stash", BrainStash,
                "The Pantry", ThePantry
            )
    },
    RemoveIf(colBreadcrumbs, ID >= newID);
    Collect(colBreadcrumbs, { ID: newID, Title: ThisItem.Title, Screen: scr })
)

ControlPropertyState.AutoRuleBindingString:
// Remember the selected key and tell the host to navigate
Set(varMenuKey, ThisItem.ScreenName);
cmpNav.OnNavigate(ThisItem.ScreenName)

Rules.InvariantScript:
Set(varKBCurrent, Defaults('Knowledge Article'));
Set(varKBMode, "New");
Set(varKBOpen, true);
Set(varFadeIn, true);
Set(varFading, false);  // force edge
Set(varFading, true);   // start fade-in

Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);  // force edge
Set(varFading, true);   // start fade-out
Set(varKBMode, Blank());

// Close modal
Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);
Set(varFading, true);
Set(varKBMode, Blank());

// Remove the most recent breadcrumb (or all, if you prefer)
If(
    CountRows(colBreadcrumbs) > 0,
    RemoveIf(colBreadcrumbs, ID = Max(colBreadcrumbs, ID))
)

Set(varKBOpen, false);
Set(varKBMode, Blank());
Set(varRunModalTimer, true);   // animate out on success
Notify("Article saved.", NotificationType.Success);
Reset(txtKBSearch);

ResetForm(frmKB);
Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);  // force edge
Set(varFading, true);   // start fade-out
Set(varKBMode, Blank());

// Close modal
Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);
Set(varFading, true);
Set(varKBMode, Blank());

// Remove the most recent breadcrumb (or all, if you prefer)
If(
    CountRows(colBreadcrumbs) > 0,
    RemoveIf(colBreadcrumbs, ID = Max(colBreadcrumbs, ID))
)

SubmitForm(frmKB);
Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);  // force edge
Set(varFading, true);   // start fade-out
Set(varKBMode, Blank());

// Close modal
Set(varKBOpen, false);
Set(varFadeIn, false);
Set(varFading, false);
Set(varFading, true);
Set(varKBMode, Blank());

// Remove the most recent breadcrumb (or all, if you prefer)
If(
    CountRows(colBreadcrumbs) > 0,
    RemoveIf(colBreadcrumbs, ID = Max(colBreadcrumbs, ID))
)

// Existing modal open logic
Set(varKBCurrent, ThisItem);
Set(varKBMode, "View");
Set(varKBOpen, true);
Set(varFadeIn, true);
Set(varFading, false);   // edge
Set(varFading, true);    // start fade-in

With(
    { next: varModalLevel + 1, title: Trim(lblKBTitle.Text) },
    RemoveIf(colBreadcrumbs, ID > varModalLevel);
    Collect(colBreadcrumbs, { ID: next, Title: title });
    Set(varModalLevel, next)
)
